import { Fragment } from "react";
import Header from "../header/Header";
import Footer from "./Footer";

const TermsOfUse = () => {
  return (
    <Fragment>
      <Header></Header>
      <div>Terms Of Use:</div>
      <div></div>
      <Footer></Footer>
    </Fragment>
  );
};

export default TermsOfUse;
